import React, { useState } from 'react';
import './Signup.scss';

const Signup = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic
    console.log('Form submitted:', { firstName, lastName, username, password });
  };

  return (
    <div className="signup-container">
      <h2>Create your Google Account</h2>
      <form onSubmit={handleSubmit}>
        <div className="input-group">
          <label>First name</label>
          <input 
            type="text" 
            value={firstName} 
            onChange={(e) => setFirstName(e.target.value)} 
          />
        </div>
        <div className="input-group">
          <label>Last name</label>
          <input 
            type="text" 
            value={lastName} 
            onChange={(e) => setLastName(e.target.value)} 
          />
        </div>
        <div className="input-group">
          <label>Username</label>
          <input 
            type="text" 
            value={username} 
            onChange={(e) => setUsername(e.target.value)} 
          />
          <small>You can use letters, numbers & periods</small>
        </div>
        <div className="input-group">
          <label>Password</label>
          <input 
            type="password" 
            value={password} 
            onChange={(e) => setPassword(e.target.value)} 
          />
        </div>
        <div className="input-group">
          <label>Confirm</label>
          <input 
            type="password" 
            value={confirmPassword} 
            onChange={(e) => setConfirmPassword(e.target.value)} 
          />
          <small>Use 8 or more characters with a mix of letters, numbers & symbols</small>
        </div>
        <button type="submit">Next</button>
      </form>
      <div className="footer">
        <p>One account. All of Google working for you.</p>
        <p>Sign in instead</p>
      </div>
    </div>
  );
};

export default Signup;
